import React from 'react'
import img from '../assets/CompanyLogo.png'
import { Image } from 'react-bootstrap'

export default function SecondCategoryList() {
	return (
		<div className='pb-4 d-flex justify-content-center second-category-list'>
			{
				[null, null, null, null, null].map((category) => (
					<a className='pt-3 ps-2 d-flex flex-column align-items-center'>
						<Image src={img} className='mb-3 img-fluid' roundedCircle className="second-category-list"/>
						<span>
							kahve
						</span>
					</a>
				))
			}
		</div>
	)
}
